import React from 'react';
import classes from './TaskList.module.css';

const TaskList = (props) => {
  // Responsable On Get The Data In The Form (( Get Request))

  const dummyData = [
    {
      taskDetails: 'moemen',
      taskEndDate: '22/9/2021',
      taskId: '10',
    },
  ];

  return (
    <>
      <section>
        <div className={classes.task}>
          {dummyData.map((data) => (
            <div>
              <h3>{data.taskDetails}</h3>
              <p> {data.taskEndDate}</p>
              <p> {data.taskId}</p>
            </div>
          ))}
        </div>
        <button>Delete</button>
      </section>
    </>
  );
};

export default TaskList;
